(function(){$(function(){$("#LoginButton").click(function(n){n.preventDefault();var t=$("#LoginForm");abp.ui.setBusy($("#LoginArea"),abp.ajax({contentType:"application/x-www-form-urlencoded",url:t.attr("action"),data:t.serialize()}))});$("a.social-login-link").click(function(){var n=$(this),t=n.closest("form");t.find("input[name=provider]").val(n.attr("data-provider"));t.submit()});$("#ReturnUrlHash").val(location.hash);$("#LoginForm input:first-child").focus()})})();